import Similar from './Similar';
import web from '../src/images/home.svg';

const Home = () => {
    return (
        <>
            <Similar 
            name='Grow your business with' 
            visit='/services' 
            buttonName="Get Started" 
            imgSrc={web} 
            paragraph=''    
            />
        </>
    );
}

export default Home;
